import wmi
import os
from tkinter import *
import tkinter.font as tkFont


class information:
    w = wmi.WMI()
    list = []
    path = os.path.dirname(os.path.abspath(__file__))
    fileName = os.path.join(path, '主机配置信息.txt')


class INFO(information):
    def __init__(self):
        self.info()

    # 获取配置信息
    def info(self):

        for BIOSs in information.w.Win32_ComputerSystem():
            information.list.append("电脑名称: %s" % BIOSs.Caption)
            information.list.append("电脑用户: %s" % BIOSs.UserName)
        for version in information.w.Win32_OperatingSystem():
            information.list.append("操作系统:%s" % version.Caption)
            information.list.append("系统位数：%s" % version.OSArchitecture)
            information.list.append("系统版本：%s" % version.Version)
        for address in information.w.Win32_NetworkAdapterConfiguration(IPEnabled=TRUE):
            if address.DefaultIPGateway:
                information.list.append("IP地址: %s" % address.IPAddress[0])
                information.list.append("MAC地址: %s" % address.MACAddress)
        for BIOS in information.w.Win32_BIOS():
            information.list.append("主板厂商: %s" % BIOS.Manufacturer)
            information.list.append("主板名称: %s" % BIOS.Name)
            information.list.append("使用日期: %s" % BIOS.ReleaseDate)
            information.list.append("主板SN号: %s" % BIOS.SerialNumber)
        for processor in information.w.Win32_Processor():
            information.list.append("CPU型号: %s" % processor.Name.strip())
            information.list.append("CPU核数: %s" % processor.NumberOfLogicalProcessors)
        for memModule in information.w.Win32_PhysicalMemory():
            totalMemSize = int(memModule.Capacity)
            information.list.append("内存厂商: %s" % memModule.Manufacturer)
            information.list.append("内存型号: %s" % memModule.PartNumber)
            information.list.append("内存大小: %.2fGB" % (totalMemSize / 1024 ** 3))
        for disk in information.w.Win32_DiskDrive():
            diskSize = int(disk.size)
            information.list.append("磁盘名称: %s" % disk.Caption)
            information.list.append("磁盘大小: %.2fGB" % (diskSize / 1024 ** 3))
        for xk in information.w.Win32_VideoController():
            information.list.append("显卡名称: %s" % xk.name)


class fileHandling(information):
    def __init__(self, group, username, remarks):
        self.group = group
        self.username = username
        self.remarks = remarks
        self.start = '-' * 20
        self.end = '-' * 20
        self.message = '%s\n\t部门：%s\n\t姓名：%s\n\t备注：%s\n%s\n' % (
            self.start, self.group, self.username, self.remarks, self.end)
        self.file()
        self.write()

    # 判断文件夹（路径）是否存在
    def file(self):
        if not os.path.exists(information.path):
            # 创建文件夹（文件路径）
            os.makedirs(information.path)

    # 写入数据
    def write(self):
        with open(information.fileName, 'w+') as f:
            f.write(self.message)
            for li in information.list:
                l = li + "\n"
                f.write(l)


