    def start(self):
        group = self.entInput2.get()
        username = self.entInput3.get()
        remarks = self.entInput4.get()
        if not group:
            self.lable8['text'] = '请输入部门名称'
            return
        if not username:
            self.lable8['text'] = '请输入姓名'
            return
        if not remarks:
            remarks = '无'
        try:
            information()
            INFO()
            fileHandling(group, username, remarks)
            self.lable8['text'] = '采集完成'
        except:
            self.lable8['text'] = '发生未知错误'

    def dele(self):
        self.entInput2.delete(0, END)
        self.entInput3.delete(0, END)
        self.entInput4.delete(0, END)
        self.lable8['text'] = ''


